import React from 'react';
import headerLogo from '../images/header-logo.svg';

function Header() {
  return (
    <header className="header">
      <img src={headerLogo} alt="Логотип Место" className="logo" />
      <button type="submit" className="header__button-authentication" aria-label="Сохранить изменения">
        <h3 className="header__button-title-login">Войти</h3>
        <h3 className="header__button-title-logup">Регистрация</h3>
      </button>
    </header>
  );
}

export default Header;
